svg.script:
window.addEventListener("load", function (event) {
currSVG = document.getElementById('podz-svg');
     var sliderPathAll = currSVG.querySelectorAll('.podz-anim');
         sliderPathAll.forEach(function(currPath) {
              var length = currPath.getTotalLength();
              currPath.style.transition = currPath.style.WebkitTransition = 'none'; // Clear any previous transition
              currPath.style.strokeDasharray = length + ' ' + length; // Set up the starting positions
              currPath.style.strokeDashoffset = length;
              currPath.style.setProperty('--startOffset',length);
              var currDelay = 0.5 + 1 * Math.random();
              currPath.style.animationDelay = currDelay + 's';
              var currTime = 1 + 2 * Math.random();
              currPath.style.animationDuration = currTime + 's';
              });
});
